import React from 'react'
import {Form, FormGroup, Input} from 'reactstrap'
import ImageModal from './ImageModal';

function SearchBar({setImage}){
    return(
        <div style={{"padding":"2% 10% 2% 10%"}}>
            <Form inline="true">
                <FormGroup>
                    <Input style={{"borderRadius":"50px", "height":"50px"}} type="text" placeholder="Search Images ..."></Input>
                </FormGroup>
                <FormGroup>
                    <ImageModal setImage= {setImage} buttonLabel="Upload"></ImageModal>
                </FormGroup>
            </Form>
        
        </div>
    );
}

export default SearchBar
